  "Sanction Details" : "**12/11/06**HEARING BOARD DECISION ISSUED ON DECEMBER 11, 2006 DECISION:  ENGAGED IN CONDUCT INCONSISTENT WITH JUST AND EQUITABLE PRINCIPLES OF TRADE IN VIOLATION OF NYSE RULE 476(A) BY ENGAGING IN THE OFFER OR SALE OF AN UNREGISTERED SECURITY THROUGH A PRIVATE PLACEMENT OFFERING THAT DID NOT QUALIFY FOR AN EXEMPTION FROM REGISTRATION, VIOLATING SECTION 5 OF THE SECURITIES ACT OF 1933; SOLD A PRIVATE PLACEMENT SECURITY TO AT LEAST 14 CUSTOMERS OF HIS MEMBER FIRM EMPLOYER BASED ON OFFERING MEMORANDA THAT CONTAINED MATERIAL MISREPRESENTATIONS AND/OR OMISSIONS OF MATERIAL FACT; RECOMMENDED AND EFFECTED UNSUITABLE PRIVATE PLACEMENT TRANSACTIONS IN THE ACCOUNTS OF AT LEAST NINE CUSTOMERS OF HIS MEMBER FIRM EMPLOYER GIVEN THE CUSTOMERS FINANCIAL RESOURCES AND INABILITY TO ASSUME THE RISK OF THE LOSS OF THEIR INVESTMENT; AND FAILED TO FULLY DISCLOSE TO AT LEAST 14 CUSTOMERS OF HIS MEMBER FIRM EMPLOYER THE RISKS INVOLVED IN CONNECTION WITH THE SOLICITATION AND SALE OF A PRIVATE PLACEMENT SECURITY.  PENALTY:  THE IMPOSITION BY THE NYSE OF A CENSURE AND A ONE-YEAR BAR FROM MEMBERSHIP, ALLIED MEMBERSHIP, APPROVED PERSON STATUS, AND FROM EMPLOYMENT OR ASSOCIATION IN ANY CAPACITY WITH ANY NYSE MEMBER FIRM OR MEMBER ORGANIZATION, AND AN UNDERTAKING TO COOPERATE WITH NYSE REGULATION INC. DIVISION OF ENFORCEMENT."
